contracts/DarwinPresale.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.14;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

import {IDarwinPresale} from "./interface/IDarwinPresale.sol";
import {IDarwin} from "./interface/IDarwin.sol";

/// @title Darwin Presale
contract DarwinPresale is IDarwinPresale, ReentrancyGuard, Ownable {
    /// @notice Min ETH deposit per user
    uint256 public constant RAISE_MIN = .1 ether; //TODO: MODIFY
    /// @notice Max ETH deposit per user
    uint256 public constant RAISE_MAX = 4_000 ether; //TODO: MODIFY
    /// @notice Max number of ETH to be raised
    uint256 public constant HARDCAP = 396 ether;

    /// @notice The Darwin token
    IERC20 public darwin;
    /// @notice Timestamp of the presale start
    uint256 public presaleStart;
    /// @notice Timestamp of the presale end
    uint256 public presaleEnd;
    /// @notice Wallet 1
    address public wallet1;

    /// @notice Mapping of total ETH deposited by user
    mapping(address => uint256) public userDeposits;
    /// @notice Status of the presale
    PresaleStatus public status;

    /// @notice True if presale has been initialized
    bool private _isInitialized;

    modifier isInitialized() {
        if (!_isInitialized) {
            revert NotInitialized();
        }
        _;
    }

    /// @dev Initializes the Darwin Protocol address
    /// @param _darwin The Darwin Protocol address
    function init(
        address _darwin
    ) external onlyOwner {
        if (_isInitialized) revert AlreadyInitialized();
        if (_darwin == address(0)) revert ZeroAddress();

        darwin = IERC20(_darwin);

        _setWallet1(0x0bF1C4139A6168988Fe0d1384296e6df44B27aFd);
    }

    /// @dev Starts the presale, and sets presale end date to 90 days after block.timestamp
    function startPresale() external onlyOwner {
        if (_isInitialized) revert AlreadyInitialized();
        _isInitialized = true;

        presaleStart = block.timestamp;
        presaleEnd = presaleStart + (90 days);
    }

    /// @notice Deposits ETH into the presale
    /// @dev Emits a UserDeposit event
    /// @dev Emits a RewardsDispersed event
    function userDeposit() external payable nonReentrant isInitialized {

        if (presaleStatus() != Status.ACTIVE) {
            revert PresaleNotActive();
        }

        uint256 base = userDeposits[msg.sender];

        if (msg.value < RAISE_MIN || base + msg.value > RAISE_MAX) {
            revert InvalidDepositAmount();
        }

        if (base == 0) {
            // new depositer
            ++status.numBuyers;
        }

        userDeposits[msg.sender] += msg.value;

        uint256 darwinAmount = calculateDarwinAmount(msg.value);

        status.raisedAmount += msg.value;
        status.soldAmount += darwinAmount;

        if (!darwin.transfer(msg.sender, darwinAmount)) {
            revert TransferFailed();
        }

        emit UserDeposit(msg.sender, msg.value, darwinAmount);
    }

    /// @notice Set the presale end date to `_endDate`
    /// @param _endDate The new presale end date
    function setPresaleEndDate(uint256 _endDate) external onlyOwner {
        // solhint-disable-next-line not-rely-on-time
        if (_endDate < block.timestamp || _endDate < presaleStart || _endDate > presaleEnd) {
            revert InvalidEndDate();
        }
        presaleEnd = _endDate;
        emit PresaleEndDateSet(_endDate);
    }

    /// @notice Set addresses for Wallet 1
    /// @param _wallet1 The new Wallet 1 address
    function setWallet1(
        address _wallet1
    ) external onlyOwner {
        if (_wallet1 == address(0)) {
            revert ZeroAddress();
        }
        _setWallet1(_wallet1);
    }

    /// @notice Sends ETH and unsold Darwin to Wallet 1
    function withdrawETHAndUnsoldDarwin() external onlyOwner {
        if (presaleStatus() != Status.SUCCESS) {
            revert PresaleNotEnded();
        }

        uint balance = address(this).balance;
        if (balance > 0) {
            _transferETH(wallet1, balance);
        }

        uint darwinBalance = darwin.balanceOf(address(this));
        if (darwinBalance > 0) {
            darwin.transfer(wallet1, darwinBalance);
        }

        emit PresaleCompleted(balance, darwinBalance);
    }

    /// @notice Returns the current stage of the presale
    /// @return stage The current stage of the presale
    function getCurrentStage() external view returns (uint256 stage) {
        stage = _getCurrentStage();
    }

    function tokensDepositedAndOwned(
        address account
    ) external view returns (uint256, uint256) {
        uint256 deposited = userDeposits[account];
        uint256 owned = darwin.balanceOf(account);
        return (deposited, owned);
    }

    /// @notice Returns the number of tokens left to raise on the current stage
    /// @return tokensLeft The number of tokens left to raise on the current stage
    function baseTokensLeftToRaiseOnCurrentStage()
        public
        view
        returns (uint256 tokensLeft)
    {
        (, , uint256 stageCap) = _getStageDetails(_getCurrentStage());
        tokensLeft = stageCap - status.raisedAmount;
    }

    /// @notice Returns the current presale status
    /// @return The current presale status
    function presaleStatus() public view returns (Status) {
        if (!_isInitialized) {
            return Status.QUEUED;
        }

        // solhint-disable-next-line not-rely-on-time
        if (status.raisedAmount >= HARDCAP || block.timestamp > presaleEnd) {
            return Status.SUCCESS; // Wonderful, presale has ended
        }

        // solhint-disable-next-line not-rely-on-time
        if (block.timestamp >= presaleStart && block.timestamp <= presaleEnd) {
            return Status.ACTIVE; // ACTIVE - Deposits enabled, now in Presale
        }

        return Status.QUEUED; // QUEUED - Awaiting start block
    }

    /// @notice Calculates the number of tokens that can be bought with `ethAmount` ETH
    /// @param ethAmount The number of ETH to be deposited
    /// @return The number of Darwin to be purchased with `ethAmount` ETH
    function calculateDarwinAmount(
        uint256 ethAmount
    ) public view returns (uint256) {
        if (ethAmount > HARDCAP - status.raisedAmount) {
            revert AmountExceedsHardcap();
        }
        uint256 tokensLeft = baseTokensLeftToRaiseOnCurrentStage();
        if (ethAmount < tokensLeft) {
            return ((ethAmount * _getCurrentRate()));
        } else {
            uint256 stage = _getCurrentStage();
            uint256 darwinAmount;
            uint256 rate;
            uint256 stageAmount;
            uint256 stageCap;
            uint amountRaised = status.raisedAmount;
            while (ethAmount > 0) {
                (rate, stageAmount, stageCap) = _getStageDetails(stage);
                uint amountLeftInStage = stageCap - amountRaised;
                if (ethAmount <= amountLeftInStage) {
                    darwinAmount += (ethAmount * rate);
                    ethAmount = 0;
                    break;
                }

                amountRaised += amountLeftInStage;
                darwinAmount += (amountLeftInStage * rate);
                ethAmount -= amountLeftInStage;

                ++stage;
            }

            return darwinAmount;
        }
    }

    function _transferETH(address to, uint256 amount) internal {
        // solhint-disable-next-line avoid-low-level-calls
        (bool success, ) = payable(to).call{value: amount}("");
        if (!success) {
            revert TransferFailed();
        }
    }

    function _setWallet1(address _wallet1) internal {
        wallet1 = _wallet1;
        emit Wallet1Set(_wallet1);
    }

    function _getCurrentRate() private view returns (uint256 rate) {
        (rate, , ) = _getStageDetails(_getCurrentStage());
    }

    function _getCurrentStage() private view returns (uint256) {
        uint raisedAmount = status.raisedAmount;
        if (raisedAmount > 50 ether) {
            return 2;
        } else if (raisedAmount > 20 ether) {
            return 1;
        } else {
            return 0;
        }
    }

    function _getStageDetails(
        uint256 stage
    ) private pure returns (uint256, uint256, uint256) {
        assert(stage <= 2);
        if (stage == 0) {
            return (5300, 20 ether, 20 ether);
        } else if (stage == 1) {
            return (4800, 30 ether, 50 ether);
        } else {
            return (4250, 326 ether, 396 ether);
        }
    }
}

contracts/DarwinPrivateSale.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.14;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import {IDarwinPresale} from "./interface/IDarwinPresale.sol";
import {IDarwinVester} from "./interface/IDarwinVester.sol";
import {IDarwin} from "./interface/IDarwin.sol";

/// @title Darwin Private Sale
contract DarwinPrivateSale is IDarwinPresale, ReentrancyGuard, Ownable {
    /// @notice Min BNB deposit per user
    uint256 public constant RAISE_MIN = .1 ether;
    /// @notice Max BNB deposit per user
    uint256 public constant RAISE_MAX = 200 ether;
    /// @notice Max number of BNB to be raised
    uint256 public constant HARDCAP = 500 ether;
    /// @notice How many DARWIN are sold for each BNB invested
    uint256 public constant DARWIN_PER_BNB = 10_000;
    /// @notice The % sent right away to the user. The left percentage is sent to the vester contract
    uint256 public constant PERC = 25;

    /// @notice The Darwin token
    IERC20 public darwin;
    /// @notice The Vester contract
    IDarwinVester public vester;
    /// @notice Timestamp of the presale start
    uint256 public presaleStart;
    /// @notice True if presale has been ended
    bool public privateSaleEnded;

    address public wallet1;

    /// @notice Mapping of total BNB deposited by user
    mapping(address => uint256) public userDeposits;

    PresaleStatus public status;

    bool private _isInitialized;

    modifier isInitialized() {
        if (!_isInitialized) {
            revert NotInitialized();
        }
        _;
    }

    /// @dev Initializes the darwin address and private sale start date
    /// @param _darwin The darwin token address
    /// @param _presaleStart The private sale start date
    function init(
        address _darwin,
        address _vester,
        uint256 _presaleStart
    ) external onlyOwner {
        if (_isInitialized) revert AlreadyInitialized();
        _isInitialized = true;
        if (_darwin == address(0) || _vester == address(0)) revert ZeroAddress();
        // solhint-disable-next-line not-rely-on-time
        if (_presaleStart < block.timestamp) revert InvalidStartDate();
        darwin = IERC20(_darwin);
        vester = IDarwinVester(_vester);
        // IDarwin(address(darwin)).pause();
        _setWallet1(0x0bF1C4139A6168988Fe0d1384296e6df44B27aFd);
        presaleStart = _presaleStart;
    }

    /// @notice Deposits BNB into the presale
    /// @dev Emits a UserDeposit event
    /// @dev Emits a RewardsDispersed event
    function userDeposit() external payable nonReentrant isInitialized {

        if (presaleStatus() != Status.ACTIVE) {
            revert PresaleNotActive();
        }

        if (msg.value < RAISE_MIN || msg.value > RAISE_MAX) {
            revert InvalidDepositAmount();
        }

        if (userDeposits[msg.sender] == 0) {
            // new depositer
            ++status.numBuyers;
        }

        userDeposits[msg.sender] += msg.value;

        uint256 darwinAmount = msg.value * DARWIN_PER_BNB;

        status.raisedAmount += msg.value;
        status.soldAmount += darwinAmount;

        uint256 darwinAmountToUser = (darwinAmount * PERC) / 100;

        if (!darwin.transfer(msg.sender, darwinAmountToUser)) {
            revert TransferFailed();
        }
        darwin.approve(address(vester), darwinAmount - darwinAmountToUser);
        // vester.deposit(msg.sender, darwinAmount - darwinAmountToUser);

        emit UserDeposit(msg.sender, msg.value, darwinAmount);
    }

    /// @notice Ends the private sale
    function endSale() external onlyOwner {
        // solhint-disable-next-line not-rely-on-time
        if (block.timestamp < presaleStart) {
            revert InvalidEndDate();
        }
        privateSaleEnded = true;
        emit PresaleEndDateSet(block.timestamp);
    }

    /// @notice Set address for Wallet1
    /// @param _wallet1 The new Wallet1 address
    function setWallet1(
        address _wallet1
    ) external onlyOwner {
        if (_wallet1 == address(0)) {
            revert ZeroAddress();
        }
        _setWallet1(_wallet1);
    }

    /// @dev Sends any unsold Darwin and raised BNB to Wallet 1
    function withdrawUnsoldDarwinAndRaisedBNB() external onlyOwner {
        if (wallet1 == address(0)) {
            revert ZeroAddress();
        }
        if (presaleStatus() != Status.SUCCESS) {
            revert PresaleNotEnded();
        }

        _transferBNB(wallet1, address(this).balance);

        // Send any unsold Darwin to Wallet 1
        if (darwin.balanceOf(address(this)) > 0) {
            darwin.transfer(wallet1, darwin.balanceOf(address(this)));
        }
    }

    function tokensDepositedAndOwned(
        address account
    ) external view returns (uint256, uint256) {
        uint256 deposited = userDeposits[account];
        uint256 owned = darwin.balanceOf(account);
        return (deposited, owned);
    }

    /// @notice Returns the number of BNB left to be raised on the current stage
    /// @return tokensLeft The number of BNB left to be raised on the current stage
    /// @dev The name of the function has been left unmodified to not cause mismatches with the frontend (we're using DarwinPresale typechain there)
    function baseTokensLeftToRaiseOnCurrentStage()
        public
        view
        returns (uint256 tokensLeft)
    {
        tokensLeft = HARDCAP - status.raisedAmount;
    }

    /// @notice Returns the current presale status
    /// @return The current presale status
    function presaleStatus() public view returns (Status) {
        // solhint-disable-next-line not-rely-on-time
        if (status.raisedAmount >= HARDCAP || privateSaleEnded) {
            return Status.SUCCESS; // Wonderful, presale has ended
        }

        // solhint-disable-next-line not-rely-on-time
        if (block.timestamp >= presaleStart && !privateSaleEnded) {
            return Status.ACTIVE; // ACTIVE - Deposits enabled, now in Presale
        }

        return Status.QUEUED; // QUEUED - Awaiting start block
    }

    function _transferBNB(address to, uint256 amount) internal {
        // solhint-disable-next-line avoid-low-level-calls
        (bool success, ) = payable(to).call{value: amount}("");
        if (!success) {
            revert TransferFailed();
        }
    }

    function _setWallet1(address _wallet1) internal {
        wallet1 = _wallet1;
        emit Wallet1Set(_wallet1);
    }
}

contracts/EvoturesNFT.sol.content:
pragma solidity ^0.8.14;

// SPDX-License-Identifier: MIT

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

import {LootboxTicket} from "./LootboxTicket.sol";

import {IEvoturesNFT} from "./interface/IEvoturesNFT.sol";
import {ILootboxTicket} from "./interface/ILootboxTicket.sol";

contract EvoturesNFT is ERC721("Test Evotures","TESTEVO"), IEvoturesNFT {
    using Address for address;
    using Strings for uint256;

    address public immutable ticketsContract;
    uint public lastTokenId;

    // tokenId => Stats
    mapping(uint256 => Stats) private _stats;

    constructor() {
        // Create LootboxTicket contract
        bytes memory bytecode = type(LootboxTicket).creationCode;
        bytes32 salt = keccak256(abi.encodePacked(address(this)));
        address _ticketsContract;
        assembly {
            _ticketsContract := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        ticketsContract = _ticketsContract;
        ILootboxTicket(ticketsContract).initialize(msg.sender);
    }

    function mint(address _to, uint _ticketChances) external {
        require(msg.sender == ticketsContract, "EvoturesNFT: CALLER_IS_NOT_TICKET");
        _safeMint(_to, lastTokenId);
        _stats[lastTokenId] = _getRandomStats(_ticketChances);
        lastTokenId++;
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        _requireMinted(tokenId);

        string memory baseURI = _baseURI();
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, _stats[tokenId].no.toString(), ".json")) : "";
    }

    // TODO: SET BASE URI
    function _baseURI() internal pure override returns (string memory) {
        return "ipfs://QmXNRXbSeJVJTGFRa69u9A1wz1H17pkB8S4EXvVQtuRfTE/";
    }

    // TODO: SET CONTARCT URI
    function contractURI() public pure returns (string memory) {
        return "https://darwinprotocol.io/evotures.json";
    }

    function _pseudoRand(uint _chances, uint _seed) private view returns(uint256) {
        uint256 seed = uint256(
            keccak256(
                abi.encodePacked(
                    _seed +
                    block.timestamp +
                    block.difficulty +
                    ((
                        uint256(keccak256(abi.encodePacked(block.coinbase)))
                    ) / (block.timestamp)) +
                    block.gaslimit +
                    ((uint256(keccak256(abi.encodePacked(tx.origin)))) /
                        (block.timestamp)) +
                    block.number +
                    ((uint256(keccak256(abi.encodePacked(address(this))))) /
                        (block.timestamp)) +
                    ((uint256(keccak256(abi.encodePacked(msg.sender)))) /
                        (block.timestamp))
                )
            )
        );

        return (seed % _chances);
    }

    function _randomBoolean() private view returns (bool) {
        return uint256(keccak256(abi.encodePacked(block.difficulty, block.coinbase, block.timestamp))) % 2 > 0;
    }

    function _getRandomStats(uint _chances) private view returns(Stats memory s) {
        uint rand = _pseudoRand(_chances, 0);
        // ANCIENT
        if (rand == 0) {
            s.rarity = Rarity.ANCIENT;
            s.no = 1;
            s.multiplier = 50;
            s.hp = _pseudoRand(51, 0) + 100;
            s.attack = _pseudoRand(51, s.hp) + 100;
            s.defense = _pseudoRand(51, s.attack) + 100;
            s.speed = _pseudoRand(51, s.defense) + 100;
            s.special = _pseudoRand(51, s.special) + 100;
        // MYTHICAL
        } else if (rand <= 999) {
            s.rarity = Rarity.MYTHICAL;
            s.no = (rand % 3) + 2;
            s.multiplier = 25;
            s.hp = _pseudoRand(51, 0) + 75;
            s.attack = _pseudoRand(51, s.hp) + 75;
            s.defense = _pseudoRand(51, s.attack) + 75;
            s.speed = _pseudoRand(51, s.defense) + 75;
            s.special = _pseudoRand(51, s.special) + 75;
        // ULTRARARE
        } else if (rand <= 9999) {
            s.rarity = Rarity.ULTRARARE;
            s.no = (rand % 10) + 5;
            s.multiplier = 10;
            s.hp = _pseudoRand(41, 0) + 60;
            s.attack = _pseudoRand(41, s.hp) + 60;
            s.defense = _pseudoRand(41, s.attack) + 60;
            s.speed = _pseudoRand(41, s.defense) + 60;
            s.special = _pseudoRand(41, s.special) + 60;
        // RARE
        } else if (rand <= 29999) {
            s.rarity = Rarity.RARE;
            s.no = (rand % 15) + 15;
            s.multiplier = 5;
            s.hp = _pseudoRand(51, 0) + 40;
            s.attack = _pseudoRand(51, s.hp) + 40;
            s.defense = _pseudoRand(51, s.attack) + 40;
            s.speed = _pseudoRand(51, s.defense) + 40;
            s.special = _pseudoRand(51, s.special) + 40;
        // COMMON
        } else {
            s.rarity = Rarity.COMMON;
            s.no = (rand % 21) + 30;
            s.multiplier = 1;
            s.hp = _pseudoRand(61, 0) + 5;
            s.attack = _pseudoRand(61, s.hp) + 5;
            s.defense = _pseudoRand(61, s.attack) + 5;
            s.speed = _pseudoRand(61, s.defense) + 5;
            s.special = _pseudoRand(61, s.special) + 5;
        }

        if (_randomBoolean()) {
            s.alignment = Alignment.ABOMINATION;
            s.no += 1000;
        } else {
            s.alignment = Alignment.DIVINE;
        }
    }

    function stats(uint _tokenId) external view returns(Stats memory) {
        _requireMinted(_tokenId);
        return _stats[_tokenId];
    }
}

contracts/interface/IDarwin.sol.content:
pragma solidity ^0.8.14;

// SPDX-License-Identifier: MIT

import {IStakedDarwin} from "./IStakedDarwin.sol";

interface IDarwin {

    /// @notice Accumulatively log sold tokens
    struct TokenSellLog {
        uint40 lastSale;
        uint216 amount;
    }

    event ExcludedFromReflection(address account, bool isExcluded);
    event ExcludedFromSellLimit(address account, bool isExcluded);
    event SetLive(uint timestamp);
    event SetPaused(uint timestamp);
    event SetUnpaused(uint timestamp);
    event SetPauseWhitelist(address account, bool isWhitelisted);
    event SetPresaleAddress(address account);

    // PUBLIC
    function distributeRewards(uint256 amount) external;
    function bulkTransfer(address[] calldata recipients, uint256[] calldata amounts) external;

    // COMMUNITY
    // function upgradeTo(address newImplementation) external; RESTRICTED
    // function upgradeToAndCall(address newImplementation, bytes memory data) external payable; RESTRICTED
